import React, { Component } from 'react';
import { Nav, Collapse, Navbar, NavbarBrand, Jumbotron, NavbarToggler, NavItem , Button, Modal , ModalHeader, ModalBody, Form, FormGroup,Input, Label} from 'reactstrap';
import { NavLink } from 'react-router-dom';

class Header extends Component {
	constructor(props) {
		super(props);

		this.state = {
			isNavOpen: false,
			isModalOpen:false
		};
		this.toggleNav = this.toggleNav.bind(this);
		this.toggleModal = this.toggleModal.bind(this);

	}

	toggleModal() {
		this.setState({
			isModalOpen: !this.state.isModalOpen
		});
	}
	toggleNav() {
		this.setState({
			isNavOpen: !this.state.isNavOpen
		});
	}

	handleLogin(){
		alert()
	}
	render() {
		return (
			<React.Fragment>
				<Jumbotron fluid>
					<div className="container">
						<div className="row">
							<div className="col">
								<h1>Nucamp</h1>
								<h2>a better way to camp</h2>
							</div>
						</div>
					</div>
				</Jumbotron>
				<Navbar dark sticky="top" expand="md">
					<div className="container">
						<NavbarBrand className="mr-auto" href="/">
							<img src="/assets/images/logo.png" height="30" width="30" alt="NuCamp Logo" />
						</NavbarBrand>
						<NavbarToggler onClick={this.toggleNav} />
						<Collapse isOpen={this.state.isNavOpen} navbar>
							<Nav navbar>
								<NavItem>
									<NavLink ClassName="nav-link" to="/home">
										<i className="fa fa-home fa-lg" /> Home
									</NavLink>
								</NavItem>
								<NavItem>
									<NavLink className="nav-link" to="/directory">
										<i className="fa fa-list fa-lg" /> Directory
									</NavLink>
								</NavItem>
								<NavItem>
									<NavLink className="nav-link" to="/aboutus">
										<i className="fa fa-info fa-lg" /> About
									</NavLink>
								</NavItem>
								<NavItem>
									<NavLink className="nav-link" to="/contactus">
										<i className="fa fa-address-card fa-lg" /> Contact Us
									</NavLink>
								</NavItem>
							</Nav>
							<span className="navbar-text ml-auto">
							<Button outline onClick={this.toggleModal}>
							<i className="fa fa-sign-in fa-lg"/> Login
							</Button>
							</span>
						</Collapse>
					</div>
				</Navbar>
				<Modal isOpen={this.state.isModalOpen} toggle={this.toggleModal}>
					<ModalHeader toggle={this.toggleModal}>Login</ModalHeader>
					<ModalBody>
						<Form onSubmit={this.handleLogin}>
						<FormGroup>
							<Label htmlFor="username">Username</Label>
							<Input type="text" id="username" name="username"/>
						</FormGroup>
							<FormGroup>
								<Label htmlFor="password">password</Label>
								<Input type="password" id="password" name="password" />
							</FormGroup>
							<FormGroup check>
								<Label htmlFor="remember">Remember Me</Label>
								<Input type="checkbox" id="remember" name="remember" />
							</FormGroup>

						</Form>
					</ModalBody>
				</Modal>
			</React.Fragment>
		);
	}
}

export default Header;
